INSERT INTO `accountant_book` VALUES (27, '1', '0,1,', '1001', 30, NULL, NULL, 'kcxj', '库存现金', 'cash', 'left', 'assets', 'money_funds', '', '', '1', 'enterprise', '', '2017-09-15 17:51:25', '企业的库存现金。企业有内部周转使用备用金的，可以单独设置&ldquo;备用金&rdquo;科目。期末借方余额，反映企业持有的库存现金。', '0');
INSERT INTO `accountant_book` VALUES (28, '1', '0,1,', '1002', 30, NULL, NULL, 'yhck', '银行存款', 'bank_money', 'left', 'assets', 'money_funds', '', '', '1', 'enterprise', '', '2017-09-15 17:52:08', '企业存入银行或者其他金融机构的各种款项。银行汇票存款、银行本票存款、信用卡存款、信用证保证金存款、存出投资款、外埠存款等，在&ldquo;其他货币资金&rdquo;科目核算。期末借方余额，反映企业存在银行或者其他金融机构的各种款项。', '0');
INSERT INTO `accountant_book` VALUES (29, '1', '0,1,', '1012', 30, NULL, NULL, 'qthbzj', '其他货币资金', 'current_assets', 'left', 'assets', 'money_funds', '', '', '1', 'enterprise', '', '2017-09-15 17:52:59', '企业的银行汇票存款、银行本票存款、信用卡存款、信用证保证金存款、存出投资款、外埠存款等其他货币资金。期末借方余额，反映企业持有的其他货币资金。', '0');
INSERT INTO `accountant_book` VALUES (30, '1', '0,1,', '1121', 30, NULL, NULL, 'yspj', '应收票据', 'current_assets', 'left', 'assets', 'current_assets', '', '', '1', 'enterprise', '', '2017-09-15 17:55:27', '企业因销售商品、提供劳务等而收到的商业汇票，包括银行承兑汇票、商业承兑汇票。期末借方余额，反映企业持有的商业汇票的票面金额。', '0');
INSERT INTO `accountant_book` VALUES (31, '1', '0,1,', '1122', 30, NULL, NULL, 'yszk', '应收账款', 'current_assets', 'left', 'assets', 'receivable', '', '', '1', 'enterprise', '', '2017-09-15 17:55:55', '企业因销售商品、提供劳务等经营活动而应该收取的款项。因销售商品、提供劳务等而采用递延方式收取合同或者协议价款、实质上具有融资性质的，在&ldquo;长期应收款&rdquo;科目核算。期末借方余额，反映企业尚未收回的应收账款;期末贷方余额，放映企业预收的账款。', '0');
INSERT INTO `accountant_book` VALUES (32, '1', '0,1,', '1123', 30, NULL, NULL, 'yfzk', '预付账款', 'current_assets', 'left', 'assets', '', '', '', '1', 'enterprise', '', '2017-09-15 17:56:46', '企业按照合同规定预付的款项。预付款项情况不多的，也可以不设置本科目，将预付的款项直接计入&ldquo;应付账款&rdquo;科目。企业进行在建工程而预付的工程价款，也在本科目核算。期末借方余额，反映企业预付的款项;期末贷方余额，反映企业尚未补付的款项。', '0');
INSERT INTO `accountant_book` VALUES (33, '1', '0,1,', '1221', 30, NULL, NULL, 'qtyfk', '其他应收款', 'current_assets', 'left', 'assets', '', '', '', '1', 'enterprise', '', '2017-09-15 17:57:58', '企业除应收票据、应收账款、预付账款、应收股利、应收利息、长期应收款等等以外的其他各种应收、暂付的款项。期末借方余额，反映企业尚未收回的其他应收款项。', '0');
INSERT INTO `accountant_book` VALUES (34, '1', '0,1,', '1403', 30, NULL, NULL, 'ycl', '原材料', 'inventory', 'left', 'assets', '', '', '', '1', 'enterprise', '', '2017-09-15 17:59:07', '企业库存的各种材料，包括原料及主要材料、辅助材料、外购半成品(外购件)、修理用备件(备品备件)、包装材料、燃料等的计划成本或者实际成本。收到来料加工装配业务的原料、零件等，应当设置备查簿进行登记。期末借方余额，反映企业库存材料的计划成本或者实际成本。', '0');
INSERT INTO `accountant_book` VALUES (35, '1', '0,1,', '1405', 30, NULL, NULL, 'cksp', '库存商品', 'inventory', 'left', 'assets', '', '', '', '1', 'enterprise', '', '2017-09-15 18:00:08', '企业库存的各种商品的实际成本(或者进价)或者计划成本(或者售价)，包括库存产成品、外购商品、存放在门市部准备出售的商品、发出展览的商品以及寄存在外的商品等。接受来料加工制造的代制品、为外单位加工修理的代修品，在制造、修理完成而验收入库之后，视同企业的产成品，也通过本科目核算。期末借方余额，反映企业库存商品的实际成本(或者进价)或者计划成本(或者售价)。', '0');
INSERT INTO `accountant_book` VALUES (36, '1', '0,1,', '1601', 30, NULL, NULL, 'gdzc', '固定资产', 'fixed_assets', 'left', 'assets', '', '', '', '1', 'enterprise', '', '2017-09-15 18:01:21', '企业持有的固定资产的原价。建造承包商的临时设施，以及企业购置计算机硬件所附带的、未单独计价的软件，也通过本科目核算。期末借方余额，反映企业固定资产的原价。', '0');
INSERT INTO `accountant_book` VALUES (37, '1', '0,1,', '1701', 30, NULL, NULL, 'wxzc', '无形资产', 'non-current_assets', 'left', 'assets', '', '', '', '1', 'enterprise', '', '2017-09-15 18:04:51', '企业持有的无形资产的成本，包括专利权、非专利技术、商标权、著作权、土地使用权等。期末借方余额，反映企业无形资产的成本。', '0');
INSERT INTO `accountant_book` VALUES (38, '2', '0,2,', '5001', 30, NULL, NULL, 'sccb', '生产成本', 'production_cost', 'left', 'expenses', '', '', '', '1', 'enterprise', '', '2017-09-15 18:08:50', '企业进行工业性生产而发生的各项生产成本，包括生产各种产品(产成品、自制半成品等)、自制材料、自制工具、自制设备等。期末借方余额，反映企业尚未加工完成的在产品的成本。', '0');
INSERT INTO `accountant_book` VALUES (39, '2', '0,2,', '5101', 30, NULL, NULL, 'zzfy', '制造费用', 'production_cost', 'left', 'expenses', '', '', '', '1', 'enterprise', '', '2017-09-15 18:09:48', '企业生产车间(部门)为生产产品和提供劳务而发生的各项间接费用。企业行政管理部门为组织和管理生产经营活动而发生的管理费用，在&ldquo;管理费用&rdquo;科目核算。本科目分配计入有关成本核算对象，期末无余额。', '0');
INSERT INTO `accountant_book` VALUES (40, '2', '0,2,', '6403', 30, NULL, NULL, 'zyywsjjfj', '主营业务税金及附加', 'other_expenses', 'left', 'expenses', '', '', '', '1', 'enterprise', '', '2017-09-15 18:14:28', '企业经营活动发生的营业税、消费税、城市维护建设税、资源税和教育费附加等相关税费。房产税、车船使用税、土地使用税、印花税在&ldquo;管理费用&rdquo;科目核算，但与投资性房地产相关的房产税、土地使用税在本科目核算。期末，余额转入&ldquo;本年利润&rdquo;科目，无余额。', '0');
INSERT INTO `accountant_book` VALUES (41, '2', '0,2,', '6601', 30, NULL, NULL, 'xsfy', '销售费用', 'expenses', 'left', 'expenses', '', '', '', '1', 'enterprise', '', '2017-09-15 18:17:23', '企业销售商品和材料、提供劳务的过程中发生的各种费用，包括保险费、包装费、展览费和广告费、商品维修费、预计产品质量保证损失、运输费、装卸费等以及为销售本企业商品而专设的销售机构(含销售网点、售后服务网点等)的职工薪酬、业务费、折旧费等经营费用。企业发生的与专设销售机构相关的固定资产修理费用的后续支出，也在本科目核算。期末，余额转入&ldquo;本年利润&rdquo;科目，无余额。', '0');
INSERT INTO `accountant_book` VALUES (42, '2', '0,2,', '6602', 30, NULL, NULL, 'glfy', '管理费用', 'expenses', 'left', 'expenses', '', '', '', '1', 'enterprise', '', '2017-09-15 18:18:17', '企业为组织和管理企业生产经营所发生的管理费用，包括企业在筹建期间内发生的开办费、董事会和行政管理部门在企业的经营管理中发生的或者应该由企业统一负担的公司经费(包括行政管理部门职工工资及福利费、物料消耗、低值易耗品摊销、办公费和差旅费等)、工会经费、董事会费(包括董事会成员津贴、会议费和差旅费等)、聘请中介机构费、咨询费(含顾问费)、诉讼费、业务招待费、房产税、车船使用税、土地使用税、印花税、技术转让费、矿产资源补偿费、研究费用、排污费等。企业(商品流通)管理费用不多的，可以不设置本科目，本科目的核算内容可', '0');
INSERT INTO `accountant_book` VALUES (43, '2', '0,2,', '6603', 30, NULL, NULL, 'cwfy', '财务费用', 'expenses', 'left', 'expenses', '', '', '', '1', 'enterprise', '', '2017-09-15 18:19:05', '企业为筹集生产经营所需资金等而发生的筹资费用，包括利息支出(减利息收入)、汇兑损益以及相关的手续费、企业发生的现金折扣或者收到的现金折扣等。为购建或者生产满足资本化条件的资产而发生的应予资本化的借款费用，在&ldquo;在建工程&rdquo;、&ldquo;制造费用&rdquo;等科目核算。期末，余额转入&ldquo;本年利润&rdquo;科目，无余额。', '0');
INSERT INTO `accountant_book` VALUES (44, '2', '0,2,', '6711', 30, NULL, NULL, 'yywzc', '营业外支出', 'expenses', 'left', 'expenses', '', '', '', '1', 'enterprise', '', '2017-09-15 18:20:39', '企业发生的各项营业外支出，包括非流动资产处置损失、非货币性资产交换损失、债务重组损失、公益性捐赠支出、非常损失、盘亏损失等。期末，余额转入&ldquo;本年利润&rdquo;科目，无余额。', '0');
INSERT INTO `accountant_book` VALUES (45, '2', '0,2,', '6801', 30, NULL, NULL, 'sdsfy', '所得税费用', 'other_expenses', 'left', 'expenses', '', '', '', '1', 'enterprise', '', '2017-09-15 18:21:43', '企业确认的应该从当期利润总额中扣除的所得税费用。期末，余额转入&ldquo;本年利润&rdquo;科目，无余额。', '0');
INSERT INTO `accountant_book` VALUES (46, '2', '0,2,', '6701', 30, NULL, NULL, 'zcjzss', '资产减值损失', 'other_expenses', 'left', 'expenses', '', '', '', '1', 'enterprise', '', '2017-09-15 18:23:21', '企业因计提各项资产减值准备所形成的损失。期末，余额转入&ldquo;本年利润&rdquo;科目，无余额。', '0');
INSERT INTO `accountant_book` VALUES (47, '3', '0,3,', '4001', 30, NULL, NULL, 'sszb', '实收资本', 'capital', 'right', 'owners_equity', 'paid_in_capital', NULL, NULL, '1', 'enterprise', NULL, '2017-09-15 18:43:40', '实收资本 企业接受的投资者投入的实收资本。股份有限公司应该将本科目改为&ldquo;4001\r\n股本&rdquo;科目。企业收到的投资者的出资超过其在注册资本或者股本中所占份额的部分，作为资本溢价或者股本溢价，在&ldquo;资本公积&rdquo;科目核算。期末贷方余额，反映企业实收资本或者股本的金额。', '0');
INSERT INTO `accountant_book` VALUES (48, '3', '0,3,', '4002', 30, NULL, NULL, 'zbgj', '资本公积', 'capital', 'right', 'owners_equity', NULL, NULL, NULL, '1', 'enterprise', NULL, '2017-09-15 18:44:50', '企业收到的投资者的出资额超出其在注册资本或者股本中所占份额的部分。直接计入所有者权益的利得和损失，也通过本科目核算。期末贷方余额，反映企业的资本公积。', '0');
INSERT INTO `accountant_book` VALUES (49, '3', '0,3,', '4101', 30, NULL, NULL, 'yygj', '盈余公积', 'capital', 'right', 'owners_equity', 'capital_surplus', NULL, NULL, '1', 'enterprise', NULL, '2017-09-15 18:45:57', '企业从净利润中提取的盈余公积。期末贷方余额，反映企业的盈余公积。', '0');
INSERT INTO `accountant_book` VALUES (50, '3', '0,3,', '410411', 30, NULL, NULL, 'wfplr', '未分配利润', 'accumulated_earning', 'right', 'owners_equity', NULL, NULL, NULL, '1', 'enterprise', NULL, '2017-09-15 18:54:23', '', '0');
INSERT INTO `accountant_book` VALUES (51, '4', '0,4,', '2001', 30, NULL, NULL, 'dxjk', '短期借款', 'current_liabilities', 'right', 'liabilities', NULL, NULL, NULL, '1', 'enterprise', NULL, '2017-09-15 19:01:48', '企业向银行或者其他金融机构等借入的期限一年以下(含一年)的各种借款。期末贷方余额，反映企业尚未偿还的短期借款。', '0');
INSERT INTO `accountant_book` VALUES (52, '4', '0,4,', '2201', 30, NULL, NULL, 'yfpj', '应付票据', 'current_liabilities', 'right', 'liabilities', NULL, NULL, NULL, '1', 'enterprise', NULL, '2017-09-15 19:02:44', '企业因购买材料、商品和接受劳务供应等而开出、承兑的商业汇票，包括银行承兑汇票、商业承兑汇票。期末贷方余额，反映企业尚未到期的商业汇票的票面金额。', '0');
INSERT INTO `accountant_book` VALUES (53, '4', '0,4,', '2202', 30, NULL, NULL, 'yfzk', '应付账款', 'current_liabilities', 'right', 'liabilities', 'payable', NULL, NULL, '1', 'enterprise', NULL, '2017-09-15 19:04:07', '企业因购买材料、商品和接受劳务等经营活动而应该支付的款项。期末贷方余额，反映企业尚未支付的应付账款余额。', '0');
INSERT INTO `accountant_book` VALUES (54, '4', '0,4,', '2203', 30, NULL, NULL, 'yszk', '预收账款', 'current_liabilities', 'right', 'liabilities', '', NULL, NULL, '1', 'enterprise', NULL, '2017-09-15 19:04:47', '企业按照合同规定预收的款项。预收账款情况不多的，也可以不设置本科目，将预收的款项直接计入&ldquo;应收账款&rdquo;科目。期末贷方余额，反映企业预收的款项;期末借方余额，反映企业尚未转销的款项。', '0');
INSERT INTO `accountant_book` VALUES (55, '4', '0,4,', '2211', 30, NULL, NULL, 'yfgz', '应付工资', 'current_liabilities', 'right', 'liabilities', NULL, NULL, NULL, '1', 'enterprise', NULL, '2017-09-15 19:05:55', '企业根据有关规定应该付给职工的各种薪酬。企业(外商)按规定从净利润中提取的职工奖励及福利基金，也在本科目核算。期末贷方余额，反映企业应付未付的职工薪酬。', '0');
INSERT INTO `accountant_book` VALUES (56, '4', '0,4,', '2221', 30, NULL, NULL, 'yjsf', '应交税费', 'current_liabilities', 'right', 'liabilities', NULL, NULL, NULL, '1', 'enterprise', NULL, '2017-09-15 19:14:44', '企业按照税法等规定计算应交纳的各种税费，包括增值税、营业税、消费税、所得税、资源税、土地增值税、城市维护建设税、房产税、土地使用税、车船使用税、教育费附加、矿产资源补偿费等。企业代扣代交的个人所得税等，也通过本科目核算。期末贷方余额，反映企业尚未交纳的税费;期末借方余额，反映企业多交或者尚未抵扣的税费。', '0');
INSERT INTO `accountant_book` VALUES (57, '5', '0,5,', '6001', 30, NULL, NULL, 'zyywsr', '主营业务收入', 'income', 'right', 'income', NULL, NULL, NULL, '1', 'enterprise', NULL, '2017-09-15 19:18:18', '企业确认的销售商品、提供劳务等主营业务实现的收入。期末,余额转入&ldquo;本年利润&rdquo;，无余额。', '0');
INSERT INTO `accountant_book` VALUES (58, '4', '0,4,', '2232', 30, NULL, NULL, 'ysgl', '应付股利', 'current_liabilities', 'right', 'liabilities', NULL, NULL, NULL, '1', 'enterprise', NULL, '2017-09-15 19:21:01', '企业分配的现金股利或者利润。期末贷方余额，反映企业应付未付的现金股利或者利润。', '0');
INSERT INTO `accountant_book` VALUES (59, '5', '0,5,', '6051', 30, NULL, NULL, 'qtywsr', '其他业务收入', 'other_expenses', 'right', 'income', NULL, NULL, NULL, '1', 'enterprise', NULL, '2017-09-15 19:21:26', '企业确认的除主营业务活动以外的其他经营活动实现的收入，包括出租固定资产、出租无形资产、出租包装物和商品、销售材料、用材料进行非货币性交换(非货币性资产交换具有商业实质且公允价值能够可靠计量)或者债务重组等实现的收入。期末，余额转入&ldquo;本年利润&rdquo;科目，无余额。', '0');
INSERT INTO `accountant_book` VALUES (60, '4', '0,4,', '2241', 30, NULL, NULL, 'qtyfk', '其他应付款', 'current_liabilities', 'right', 'liabilities', NULL, NULL, NULL, '1', 'enterprise', NULL, '2017-09-15 19:23:23', '企业除应付票据、应付账款、预收账款、应付职工薪酬、应付利息、应付股利、应交税费、长期应付款等以外的其他各项应付、暂收的款项。期末贷方余额，反映企业应付未付的其他应付款项。', '0');
INSERT INTO `accountant_book` VALUES (61, '5', '0,5,', '6301', 30, NULL, NULL, 'yywsr', '营业外收入', 'other_revenue', 'right', 'income', NULL, NULL, NULL, '1', 'enterprise', NULL, '2017-09-15 19:24:37', '企业发生的各项营业外收入，主要包括非流动资产处置利得、非货币性资产交换利得、债务重组利得、政府补助、盘盈利得、捐赠利得等。期末，余额转入&ldquo;本年利润&rdquo;科目，无余额。', '0');
INSERT INTO `accountant_book` VALUES (62, '4', '0,4,', '2501', 30, NULL, NULL, 'cqjk', '长期借款', 'current_liabilities', 'right', 'liabilities', 'long_term_borrowings', NULL, NULL, '1', 'enterprise', NULL, '2017-09-15 19:24:42', '企业向银行或者其他金融机构借入的期限一年以上(不含一年)的各项借款。期末贷方余额，反映企业尚未偿还的长期借款。', '0');
INSERT INTO `accountant_book` VALUES (63, '5', '0,5,', '6111', 30, NULL, NULL, 'tzsy', '投资收益', 'other_revenue', 'right', 'income', NULL, NULL, NULL, '1', 'enterprise', NULL, '2017-09-15 19:27:16', '企业确认的投资收益或者投资损失。期末，余额转入&ldquo;本年利润&rdquo;科目，无余额。', '0');
